43X)"]},{"cell_type":"markdown","id":"d7a3c9f1","metadata":{"papermill":{"duration":0.009809,"end_time":"2023-10-21T11:16:41.686358","exception":false,"start_time":"2023-10-21T11:16:41.676549","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"44abae53","metadata":{"papermill":{"duration":0.013383,"end_time":"2023-10-21T11:16:41.710328","exception":false,"start_time":"2023-10-21T11:16:41.696945","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"cdd422d5","metadata":{"execution":{"iopub.execute_input":"2023-10-21T11:16:41.737084Z","iopub.status.busy":"2023-10-21T11:16:41.734127Z","iopub.status.idle":"2023-10-21T11:16:41.813482Z","shell.execute_reply":"2023-10-21T11:16:41.811703Z"},"papermill":{"duration":0.096265,"end_time":"2023-10-21T11:16:41.818045","exception":false,"start_time":"2023-10-21T11:16:41.72178","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>a